import React from "react";

const NotFound = () => {
  return (
    <div className="mainbox">
      <div className="err">4</div>
      <i className="far fa-question-circle fa-spin"></i>
      <div className="err2">4</div>
      <div className="msg">
        <p>
          Hmmm? Couldn't find that page...? <p>Maybe it's lost?  Maybe it never existed in the first place?</p>
        </p>
        <p>Please click one of the menu items to move to another page.</p>
      </div>
    </div>
  );
};

export default NotFound;
